import React from "react";

export const HomePage = () => {
  return (
    <div className="columns is-mobile is-centered">
      <div className="column ">
        <p className="title">Welcome to Projects Management</p>
        <div className="buttons">
          <button className="button is-primary">View Projects</button>
          <button className="button is-info">Create Projects</button>
          <button className="button is-warning">Update Projects</button>
          <button className="button is-danger">Delete Projects</button>
        </div>
      </div>
    </div>
  );
};
